using System;
namespace DiscordBot.Axie.TournamentTool
{
    public class PostBattleEntity : BattleEntity
    {
        private int damageTaken;
        private int damageDealt;

        private int counterDamageDealt;

        private int poisonDamageDealt;

        private bool isPoisoned;

        private int healingReceived;
        private int critsDone;
        private int highestCrit;


        public int GetDamageTaken() => damageTaken;
        public int GetDamageDealt() => damageDealt;
        public int GetPoisonDamageDealt() => poisonDamageDealt;
        public int GetHealingReceived() => healingReceived;
        public int GetCrits() => critsDone;
        public int GetHighestCrit() => highestCrit;

        public void addDmgTaken(int dmg) => damageTaken += dmg;
        public void addDmgDealt(int dmg) => damageDealt += dmg;

        public void addCounterDmgDealt(int dmg) => counterDamageDealt += dmg;

        public void addPoisonTick() => poisonDamageDealt ++;
        public void poisonState(bool poison) => isPoisoned = poison;

        public void healingR(int dmg) => healingReceived += dmg;
        public void AddCrit(int crit)
        {
            critsDone++;
            if (crit > highestCrit)
                highestCrit = crit;
        }
    }
}
